class Solution {
    func numberOfPowerfulInt(_ start: Int, _ finish: Int, _ limit: Int, _ s: String) -> Int {
        var count = 0
        let sInt = Int(s)!
        if sInt < start || sInt > finish {
            return 0
        }

        var prefix = 0
        let sLength = s.count
        let maxPrefixLength = String(finish).count - sLength

        while prefix < Int(pow(Double(10), Double(maxPrefixLength))) {
            let numStr = "\(prefix)\(s)"
            if let num = Int(numStr), num >= start && num <= finish {
                var isValid = true
                for digit in numStr {
                    if let digitInt = Int(String(digit)), digitInt > limit {
                        isValid = false
                        break
                    }
                }
                if isValid {
                    count += 1
                }
            }
            if prefix == 0 && maxPrefixLength == 0 {
                break
            }
            prefix += 1
        }

        return count
    }
}
